import React, { useState, useEffect } from 'react';
import { supabase } from './supabaseClient'; // Ajustez ce chemin

const FactureAffichage = () => {
    const [factures, setFactures] = useState([]);
    const [editFactureId, setEditFactureId] = useState(null);
    const [formData, setFormData] = useState({
        Client: '',
        TotalHT: 0,
        TVA: 20,
        TotalTTC: 0,
    });

    useEffect(() => {
        fetchFactures();
    }, []);

    const fetchFactures = async () => {
        const { data, error } = await supabase.from('Facture').select('*');
        if (!error) {
            setFactures(data);
        } else {
            console.error('Erreur lors du chargement des factures', error);
        }
    };

    const handleEdit = (facture) => {
        setEditFactureId(facture.id);
        setFormData(facture);
    };

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData((prev) => ({ ...prev, [name]: value }));
        if (name === 'TotalHT' || name === 'TVA') {
            const totalHT = parseFloat(formData.TotalHT);
            const tva = parseFloat(formData.TVA) / 100;
            const totalTTC = totalHT + totalHT * tva;
            setFormData((prev) => ({ ...prev, TotalTTC: totalTTC.toFixed(2) }));
        }
    };

    const handleSave = async () => {
        const { error } = await supabase
            .from('Facture')
            .update(formData)
            .match({ id: editFactureId });
        if (!error) {
            fetchFactures();
            setEditFactureId(null);
        } else {
            console.error('Erreur lors de la mise à jour', error);
        }
    };

    const handleDelete = async (id) => {
        const { error } = await supabase
            .from('Facture')
            .delete()
            .match({ id });
        if (!error) {
            fetchFactures();
        } else {
            console.error('Erreur lors de la suppression', error);
        }
    };

    return (
        <div>
            <h1>Gestion des Factures</h1>
            <table>
                <thead>
                    <tr>
                        <th>Client</th>
                        <th>Total HT</th>
                        <th>TVA</th>
                        <th>Total TTC</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {factures.map((facture) => (
                        <tr key={facture.id}>
                            <td>{editFactureId === facture.id ? <input name="Client" value={formData.Client} onChange={handleChange} /> : facture.Client}</td>
                            <td>{editFactureId === facture.id ? <input type="number" name="TotalHT" value={formData.TotalHT} onChange={handleChange} /> : facture.TotalHT}</td>
                            <td>{editFactureId === facture.id ? <input type="number" name="TVA" value={formData.TVA} onChange={handleChange} /> : facture.TVA}</td>
                            <td>{facture.TotalTTC}</td>
                            <td>
                                {editFactureId === facture.id ? (
                                    <>
                                        <button onClick={handleSave}>Save</button>
                                        <button onClick={() => setEditFactureId(null)}>Cancel</button>
                                    </>
                                ) : (
                                    <>
                                        <button onClick={() => handleEdit(facture)}>Edit</button>
                                        <button onClick={() => handleDelete(facture.id)}>Delete</button>
                                    </>
                                )}
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default FactureAffichage;
